import { Button, PageHeader } from "antd"

import { IBaseFilter } from "@shared/interfaces"
import { QueryConfig } from "@shared/config"
import React from "react"
import { UsersService } from "@shared/services/users.service"
import { useQuery } from "react-query"

type UseUserListOptions = {
	options: IBaseFilter
	config: QueryConfig<typeof UsersService.filter>
}

export const UserListPage = () => {
	const filterUserQuery = useQuery({
		queryFn: () =>
			UsersService.filter({
				page: 2,
				take: 10,
			}),
		onSuccess: (res: any) => {
			console.log(res)
		},
	})
	console.log(filterUserQuery)
	return (
		<>
			<PageHeader
				onBack={() => null}
				title="Users List"
				extra={[<Button type="primary">Refresh</Button>]}
			/>
		</>
	)
}
